import "./styles.css";
import Itpages from "./pages/Itpages.js";
import insta from "./assets/insta.png";
import amit from "./assets/amit.jpg";

export default function App() {
  return (
    <div className="App">
      <Itpages title="Itpages" src={amit} description="In cricket, eleven different men could play in eleven different ways and win a game in eleven different manners, unbound by a common playing theme, style or structure. Football, though played by eleven men and devouring massive real estate, contrarily to cricket, is bound by structures, styles, and philosophies. Thus, cricket has not had the equivalent of Catenaccio, Total Football, or Tiki Taka or Gegenpressing." />
    </div>
  );
}
